import { makeStyles } from '@material-ui/core/styles'

export const useStyles = makeStyles({
  main: {
    backgroundColor: "lightgrey",
    height: "100vh"
  },
  card:{
    border:'1px solid black',
    height: "50vh",
    padding: "10px",
    backgroundColor: "green"
  },
  cont:{
    width: "100%",
    height: "100%",
    backgroundColor: "red",
  }

})
